import logo from './logo.svg';
import './App.css';

function Ready() {
  return (
    <div className="App">
        <p>
          Ready Component
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
    </div>
  );
}

export default Ready;
